const RedLink = styled.input.attrs((props) => ({
  type: "number",
  size: 100,
  placeholder: "Your number",
}))`
  color: red;
  text-decoration: none;
  ${(props) =>
    props.fucker &&
    css`
      color: purple;
      padding: 0.3rem;
      outline: none;
      border-width: 1px;
